import axios from 'axios';

const API_URL = 'http://localhost:5000/orders';

const createOrder = (orderData) => {
    return axios.post(API_URL, orderData);
};

const getOrders = () => {
    return axios.get(API_URL);
};

export default {
    createOrder,
    getOrders
};
